const About = () => (<div><h1>About</h1><Link to = '/'> Go home </Link></div>)
export class App extends React.Component{

  render() {
    return (
      <Router>
        <Switch>
          <Route path="/about" component={About} />
          <Route path="/" component={Home} />
        </Switch>
      </Router>
    )
  }
}




